  "id_str" : "12149476854",
  "text" : "まぁそうは言うものの、そういう一部を除けば、基本的には自分は彼女に少なからず好意を持ってはいるし、乗りかかった船ではあるし、既に他のたくさんの人を巻き込んでるから、今さらどうもしないけど。",
